import React from 'react';

// Компоненты
class Users extends React.Component{

    users = [
        {
            id: 1,
            firstname: "Alexey",
            lastname: "Orlov",
            bio: "Man",
            age: 25,
            isHappy: true
        },
        {
            id: 2,
            firstname: "Lera",
            lastname: "Orlova",
            bio: "Women",
            age: 23,
            isHappy: false
        }
    ]

	render () {
        if (this.users.langht > 0 )
            return(<div>
                {this.users.map((user) => (<div className='user' key={user.id}>
                    <h3>{user.firstname} {user.lastname}</h3>
                    <p>{user.bio}</p>
                </div>))}
            </div>)
        else
            return(<div>
                <h3>Пользователей нет!</h3>
            </div>)
	}
}

export default Users;
